        internal struct CodePageRange
        {
            public ushort first;
            public ushort last;
            public ushort offset;
            public byte mask;

            public CodePageRange(ushort first, ushort last, ushort offset, byte mask)
            {
                this.first = first;
                this.last = last;
                this.offset = offset;
                this.mask = mask;
            }
        }

        internal struct CodePage
        {
            public CodePageRange[] ranges;
            public CodePageKind kind;
            public CodePageAsciiSupport asciiSupport;
            public CodePageUnicodeCoverage unicodeCoverage;
            public CodePageFlags flags;
            public ushort detectCpid;   
            public ushort cpid;         
            public ushort windowsCpid;  

            public CodePage(ushort cpid, ushort windowsCpid, CodePageKind kind, CodePageAsciiSupport asciiSupport, CodePageUnicodeCoverage unicodeCoverage, CodePageFlags flags, ushort detectCpid, CodePageRange[] ranges)
            {
                this.cpid = cpid;
                this.windowsCpid = windowsCpid;
                this.kind = kind;
                this.asciiSupport = asciiSupport;
                this.unicodeCoverage = unicodeCoverage;
                this.flags = flags;
                this.detectCpid = detectCpid;
                this.ranges = ranges;
            }
        }

